(1, 'TEST PURPOSE', 'test-purpose', 'Data Warehouse & Business Intelligence are necessary solution of the present for businesses to take full advantage of all their data. This article sheds light on what DW & BI are and how do they work.', 'ticon-blog_cover_image/1640496581-1638681092-blogpic2.jpg', 'business', '<section class=\"elementor-section elementor-top-section elementor-element elementor-element-117812f7 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"117812f7\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-2dff8880\" data-id=\"2dff8880\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-29ba61a elementor-widget elementor-widget-heading\" data-id=\"29ba61a\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">What is Data Warehouse?</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-75f968bb elementor-widget elementor-widget-text-editor\" data-id=\"75f968bb\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>A data warehouse (DW or DWH), or enterprise data warehouse (EDW), is a system that collects and aggregates data from different sources into a single, central, consistent data store to support data analysis, data mining, artificial intelligence (AI), and machine learning. A data warehouse system enables an organization to run powerful analytics on huge volumes historical data in ways that a standard database cannot. DW is the core foundation for BI activities.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-2d7c20c elementor-widget elementor-widget-image\" data-id=\"2d7c20c\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/1-300x198.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/1-768x507.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/1-500x330.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/1-800x528.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/1.png 1087w\" alt=\"\" width=\"1024\" height=\"675\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/1-300x198.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/1-768x507.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/1-500x330.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/1-800x528.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/1.png 1087w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-88f92cc elementor-widget elementor-widget-text-editor\" data-id=\"88f92cc\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Data warehouse concept</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-62ad3934 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"62ad3934\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-56a8c824\" data-id=\"56a8c824\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-113694ca elementor-widget elementor-widget-heading\" data-id=\"113694ca\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">DW Core components</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-1545544 elementor-widget elementor-widget-heading\" data-id=\"1545544\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Data sources</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-39ae6e73 elementor-widget elementor-widget-text-editor\" data-id=\"39ae6e73\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n<li>A&nbsp;data source&nbsp;is simply the&nbsp;source&nbsp;of the&nbsp;data. It can be any database, ERP system, flat file, excel, cloud source, web aps etc.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-27b860f elementor-widget elementor-widget-image\" data-id=\"27b860f\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png\" sizes=\"(max-width: 785px) 100vw, 785px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png 785w, https://brainstation-23.com/wp-content/uploads/2021/10/2-300x236.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/2-768x605.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/2-500x394.png 500w\" alt=\"\" width=\"785\" height=\"618\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png 785w, https://brainstation-23.com/wp-content/uploads/2021/10/2-300x236.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/2-768x605.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/2-500x394.png 500w\" data-sizes=\"(max-width: 785px) 100vw, 785px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-23dc36c elementor-widget elementor-widget-text-editor\" data-id=\"23dc36c\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Different types of data sources</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9233686 elementor-widget elementor-widget-heading\" data-id=\"9233686\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">ETL Tools</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9f377d6 elementor-widget elementor-widget-text-editor\" data-id=\"9f377d6\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n<li>ETL is the process of Extract, Transform and Load data.</li>\r\n<li>Data Extraction involves extracting data from different sources, while Data Transformation processes data by transforming them into a proper storage structure for the purposes of querying and analysis; finally, Data Loading describes the insertion of data into the final target database such a data warehouse.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ed0b034 elementor-widget elementor-widget-image\" data-id=\"ed0b034\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png\" sizes=\"(max-width: 865px) 100vw, 865px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png 865w, https://brainstation-23.com/wp-content/uploads/2021/10/3-300x160.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/3-768x410.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/3-500x267.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/3-800x427.png 800w\" alt=\"\" width=\"865\" height=\"462\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png 865w, https://brainstation-23.com/wp-content/uploads/2021/10/3-300x160.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/3-768x410.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/3-500x267.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/3-800x427.png 800w\" data-sizes=\"(max-width: 865px) 100vw, 865px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ab21524 elementor-widget elementor-widget-text-editor\" data-id=\"ab21524\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: ETL process at a glance</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ef1c1a7 elementor-widget elementor-widget-image\" data-id=\"ef1c1a7\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg\" sizes=\"(max-width: 814px) 100vw, 814px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg 814w, https://brainstation-23.com/wp-content/uploads/2021/10/4-300x152.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/4-768x389.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/4-500x253.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/4-800x405.jpg 800w\" alt=\"\" width=\"814\" height=\"412\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg 814w, https://brainstation-23.com/wp-content/uploads/2021/10/4-300x152.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/4-768x389.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/4-500x253.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/4-800x405.jpg 800w\" data-sizes=\"(max-width: 814px) 100vw, 814px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-f3bec53 elementor-widget elementor-widget-text-editor\" data-id=\"f3bec53\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: ETL Tools</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-4488dc70 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"4488dc70\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-64396768\" data-id=\"64396768\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-67ba519 elementor-widget elementor-widget-heading\" data-id=\"67ba519\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Database service</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-4a5f1e79 elementor-widget elementor-widget-text-editor\" data-id=\"4a5f1e79\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>In the last stage of ETL (i.e loading stage) processed and structured data is stored in the Data Warehouse. Lately, cloud-based database services are popular and best suited for data warehousing due to their availability, robustness, high performance, and scalability. Some popular database services are &ndash;</p>\r\n<ul>\r\n<li><a href=\"https://azure.microsoft.com/en-us/services/synapse-analytics/\" target=\"_blank\" rel=\"noopener\">Microsoft Azure SQL Data Warehouse</a></li>\r\n<li><a href=\"https://aws.amazon.com/redshift/?whats-new-cards.sort-by=item.additionalFields.postDateTime&amp;whats-new-cards.sort-order=desc\" target=\"_blank\" rel=\"noopener\">Amazon Redshift</a></li>\r\n<li><a href=\"https://cloud.google.com/bigquery\" target=\"_blank\" rel=\"noopener\">Google BigQuery</a></li>\r\n<li><a href=\"https://www.ibm.com/products/db2-warehouse\" target=\"_blank\" rel=\"noopener\">IBM Db2 Warehouse</a></li>\r\n<li><a href=\"https://www.oracle.com/autonomous-database/autonomous-data-warehouse/\" target=\"_blank\" rel=\"noopener\">Oracle Autonomous Data Warehouse</a></li>\r\n<li><a href=\"https://www.sap.com/products/data-warehouse-cloud.html\" target=\"_blank\" rel=\"noopener\">SAP Data Warehouse Cloud</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ba5fb2f elementor-widget elementor-widget-image\" data-id=\"ba5fb2f\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-300x143.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-768x365.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1536x731.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-500x238.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-800x381.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1280x609.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology.jpg 1597w\" alt=\"\" width=\"1024\" height=\"487\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-300x143.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-768x365.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1536x731.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-500x238.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-800x381.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1280x609.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology.jpg 1597w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9d19f8c elementor-widget elementor-widget-text-editor\" data-id=\"9d19f8c\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Some popular DW service providers</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-5c6964f7 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"5c6964f7\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-3aeb5728\" data-id=\"3aeb5728\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-76bc599 elementor-widget elementor-widget-heading\" data-id=\"76bc599\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">What is Business Intelligence (BI)?</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9dd3e57 elementor-widget elementor-widget-text-editor\" data-id=\"9dd3e57\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>The term&nbsp;<strong>Business Intelligence (BI)</strong>&nbsp;refers to technologies, applications and practices for the collection, integration, analysis, and presentation of business information.&nbsp; This information can be used to help companies make better decisions and take advantage of new opportunities. BI is about getting the right information, to the right people at the right time.</p>\r\n<blockquote>\r\n<p><strong>BI Transforms raw data, into useful and meaningful information</strong></p>\r\n</blockquote>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-222ccb10 elementor-widget elementor-widget-image\" data-id=\"222ccb10\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg\" sizes=\"(max-width: 962px) 100vw, 962px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg 962w, https://brainstation-23.com/wp-content/uploads/2021/10/6-300x195.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/6-768x499.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/6-500x325.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/6-800x520.jpg 800w\" alt=\"\" width=\"962\" height=\"625\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg 962w, https://brainstation-23.com/wp-content/uploads/2021/10/6-300x195.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/6-768x499.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/6-500x325.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/6-800x520.jpg 800w\" data-sizes=\"(max-width: 962px) 100vw, 962px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-96c74b2 elementor-widget elementor-widget-text-editor\" data-id=\"96c74b2\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: DW &amp; BI concept</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-39db717 elementor-widget elementor-widget-heading\" data-id=\"39db717\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">BI Tools</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-240ebf16 elementor-widget elementor-widget-text-editor\" data-id=\"240ebf16\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>Known also as BI software, is a type of application software designed to retrieve, analyze, transform and report data from data warehouses.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-6a60747f elementor-widget elementor-widget-image\" data-id=\"6a60747f\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/7-300x99.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/7-768x254.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/7-500x166.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/7-800x265.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/7-1280x424.png 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/7.png 1290w\" alt=\"\" width=\"1024\" height=\"339\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/7-300x99.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/7-768x254.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/7-500x166.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/7-800x265.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/7-1280x424.png 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/7.png 1290w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-26bcb012 elementor-widget elementor-widget-text-editor\" data-id=\"26bcb012\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Some popular BI tools</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-1afdde9a elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"1afdde9a\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-ce722c6\" data-id=\"ce722c6\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-b54391a elementor-widget elementor-widget-heading\" data-id=\"b54391a\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">BI Reports</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-79ac919e elementor-widget elementor-widget-text-editor\" data-id=\"79ac919e\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>BI tools provide features to build analytics reports, dashboard, apps etc. These reports can be published to web services and also can be embedded to other system as required.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-51aa029 elementor-widget elementor-widget-image\" data-id=\"51aa029\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/8-300x160.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/8-768x409.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/8-500x266.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/8-800x426.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/8-1280x681.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/8.jpg 1468w\" alt=\"\" width=\"1024\" height=\"545\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/8-300x160.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/8-768x409.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/8-500x266.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/8-800x426.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/8-1280x681.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/8.jpg 1468w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-b2e7e8f elementor-widget elementor-widget-text-editor\" data-id=\"b2e7e8f\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Sample of a BI dashboard</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-22a88314 elementor-widget elementor-widget-heading\" data-id=\"22a88314\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">How does DW &amp; BI create value for an organization?</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-1085e15b elementor-widget elementor-widget-text-editor\" data-id=\"1085e15b\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n<li>A data warehouse creates a single source of data that is consistent in format, structured in a uniform way, contains complete and accurate data that can be relied upon, and is up to date</li>\r\n<li>It is structured and designed specifically to allow data to be accessed quickly</li>\r\n<li>It provides a single integrated view of an organisation by combining data from multiple sources</li>\r\n<li>Separate environment from operational systems to facilitate improved query performance for data analytics</li>\r\n<li>Provides a complete data set, allowing you to analyse data from the past to predict the future</li>\r\n<li>BI tools provide intelligent insightful reports based on different KPIs (Key performance Index)</li>\r\n</ul>\r\n<p>All of this delivers value to the business by:</p>\r\n<ul>\r\n<li>Giving managers/stakeholders access to the information they need more quickly and easily, with significantly less ongoing effort to prepare the data</li>\r\n<li>Providing information about the business environment more quickly which means that managers can respond to changes rapidly</li>\r\n<li>Providing information more frequently</li>\r\n</ul>\r\n<p>Thus DW &amp; BI solution turns raw data to insightful information, provides intelligent analytics which leads to better understanding of the business, makes more informed managers, helps to make data driven, objective decisions &ndash; resulting in greater business stability and growth.&nbsp;<a href=\"https://brainstation-23.com/contact/\">Contact us</a>&nbsp;to see how we can help your business harness the power of Business Intelligence &amp; Data Warehouse!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 1, 'Approve', '2021-12-29 11:27:36');
INSERT INTO `blogs` (`id`, `title`, `blogSlug`, `intro`, `coverImage`, `tag`, `details`, `writer`, `state`, `date`) VALUES
(2, 'PEOPLEBOOKHR HAS ENTERED IN UAE MARKET', 'peoplebookhr-has-entered-in-uae-market', 'Data Warehouse & Business Intelligence are necessary solution of the present for businesses to take full advantage of all their data. This article sheds light on what DW & BI are and how do they work.', 'ticon-blog_cover_image/1640686243-1638695047-blog6.jpg', 'business', '<section class=\"elementor-section elementor-top-section elementor-element elementor-element-117812f7 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"117812f7\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-2dff8880\" data-id=\"2dff8880\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-29ba61a elementor-widget elementor-widget-heading\" data-id=\"29ba61a\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">What is Data Warehouse?</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-75f968bb elementor-widget elementor-widget-text-editor\" data-id=\"75f968bb\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>A data warehouse (DW or DWH), or enterprise data warehouse (EDW), is a system that collects and aggregates data from different sources into a single, central, consistent data store to support data analysis, data mining, artificial intelligence (AI), and machine learning. A data warehouse system enables an organization to run powerful analytics on huge volumes historical data in ways that a standard database cannot. DW is the core foundation for BI activities.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-2d7c20c elementor-widget elementor-widget-image\" data-id=\"2d7c20c\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/1-300x198.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/1-768x507.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/1-500x330.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/1-800x528.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/1.png 1087w\" alt=\"\" width=\"1024\" height=\"675\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/1-1024x675.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/1-300x198.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/1-768x507.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/1-500x330.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/1-800x528.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/1.png 1087w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-88f92cc elementor-widget elementor-widget-text-editor\" data-id=\"88f92cc\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Data warehouse concept</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-62ad3934 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"62ad3934\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-56a8c824\" data-id=\"56a8c824\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-113694ca elementor-widget elementor-widget-heading\" data-id=\"113694ca\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">DW Core components</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-1545544 elementor-widget elementor-widget-heading\" data-id=\"1545544\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Data sources</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-39ae6e73 elementor-widget elementor-widget-text-editor\" data-id=\"39ae6e73\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n<li>A&nbsp;data source&nbsp;is simply the&nbsp;source&nbsp;of the&nbsp;data. It can be any database, ERP system, flat file, excel, cloud source, web aps etc.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-27b860f elementor-widget elementor-widget-image\" data-id=\"27b860f\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png\" sizes=\"(max-width: 785px) 100vw, 785px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png 785w, https://brainstation-23.com/wp-content/uploads/2021/10/2-300x236.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/2-768x605.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/2-500x394.png 500w\" alt=\"\" width=\"785\" height=\"618\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/2.png 785w, https://brainstation-23.com/wp-content/uploads/2021/10/2-300x236.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/2-768x605.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/2-500x394.png 500w\" data-sizes=\"(max-width: 785px) 100vw, 785px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-23dc36c elementor-widget elementor-widget-text-editor\" data-id=\"23dc36c\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Different types of data sources</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9233686 elementor-widget elementor-widget-heading\" data-id=\"9233686\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">ETL Tools</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9f377d6 elementor-widget elementor-widget-text-editor\" data-id=\"9f377d6\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n<li>ETL is the process of Extract, Transform and Load data.</li>\r\n<li>Data Extraction involves extracting data from different sources, while Data Transformation processes data by transforming them into a proper storage structure for the purposes of querying and analysis; finally, Data Loading describes the insertion of data into the final target database such a data warehouse.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ed0b034 elementor-widget elementor-widget-image\" data-id=\"ed0b034\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png\" sizes=\"(max-width: 865px) 100vw, 865px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png 865w, https://brainstation-23.com/wp-content/uploads/2021/10/3-300x160.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/3-768x410.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/3-500x267.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/3-800x427.png 800w\" alt=\"\" width=\"865\" height=\"462\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/3.png 865w, https://brainstation-23.com/wp-content/uploads/2021/10/3-300x160.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/3-768x410.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/3-500x267.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/3-800x427.png 800w\" data-sizes=\"(max-width: 865px) 100vw, 865px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ab21524 elementor-widget elementor-widget-text-editor\" data-id=\"ab21524\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: ETL process at a glance</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ef1c1a7 elementor-widget elementor-widget-image\" data-id=\"ef1c1a7\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg\" sizes=\"(max-width: 814px) 100vw, 814px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg 814w, https://brainstation-23.com/wp-content/uploads/2021/10/4-300x152.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/4-768x389.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/4-500x253.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/4-800x405.jpg 800w\" alt=\"\" width=\"814\" height=\"412\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/4.jpg 814w, https://brainstation-23.com/wp-content/uploads/2021/10/4-300x152.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/4-768x389.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/4-500x253.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/4-800x405.jpg 800w\" data-sizes=\"(max-width: 814px) 100vw, 814px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-f3bec53 elementor-widget elementor-widget-text-editor\" data-id=\"f3bec53\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: ETL Tools</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-4488dc70 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"4488dc70\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-64396768\" data-id=\"64396768\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-67ba519 elementor-widget elementor-widget-heading\" data-id=\"67ba519\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Database service</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-4a5f1e79 elementor-widget elementor-widget-text-editor\" data-id=\"4a5f1e79\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>In the last stage of ETL (i.e loading stage) processed and structured data is stored in the Data Warehouse. Lately, cloud-based database services are popular and best suited for data warehousing due to their availability, robustness, high performance, and scalability. Some popular database services are &ndash;</p>\r\n<ul>\r\n<li><a href=\"https://azure.microsoft.com/en-us/services/synapse-analytics/\" target=\"_blank\" rel=\"noopener\">Microsoft Azure SQL Data Warehouse</a></li>\r\n<li><a href=\"https://aws.amazon.com/redshift/?whats-new-cards.sort-by=item.additionalFields.postDateTime&amp;whats-new-cards.sort-order=desc\" target=\"_blank\" rel=\"noopener\">Amazon Redshift</a></li>\r\n<li><a href=\"https://cloud.google.com/bigquery\" target=\"_blank\" rel=\"noopener\">Google BigQuery</a></li>\r\n<li><a href=\"https://www.ibm.com/products/db2-warehouse\" target=\"_blank\" rel=\"noopener\">IBM Db2 Warehouse</a></li>\r\n<li><a href=\"https://www.oracle.com/autonomous-database/autonomous-data-warehouse/\" target=\"_blank\" rel=\"noopener\">Oracle Autonomous Data Warehouse</a></li>\r\n<li><a href=\"https://www.sap.com/products/data-warehouse-cloud.html\" target=\"_blank\" rel=\"noopener\">SAP Data Warehouse Cloud</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ba5fb2f elementor-widget elementor-widget-image\" data-id=\"ba5fb2f\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-300x143.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-768x365.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1536x731.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-500x238.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-800x381.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1280x609.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology.jpg 1597w\" alt=\"\" width=\"1024\" height=\"487\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1024x487.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-300x143.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-768x365.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1536x731.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-500x238.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-800x381.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology-1280x609.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/Blog-Image-Database-technology.jpg 1597w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9d19f8c elementor-widget elementor-widget-text-editor\" data-id=\"9d19f8c\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Some popular DW service providers</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-5c6964f7 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"5c6964f7\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-3aeb5728\" data-id=\"3aeb5728\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-76bc599 elementor-widget elementor-widget-heading\" data-id=\"76bc599\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">What is Business Intelligence (BI)?</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-9dd3e57 elementor-widget elementor-widget-text-editor\" data-id=\"9dd3e57\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>The term&nbsp;<strong>Business Intelligence (BI)</strong>&nbsp;refers to technologies, applications and practices for the collection, integration, analysis, and presentation of business information.&nbsp; This information can be used to help companies make better decisions and take advantage of new opportunities. BI is about getting the right information, to the right people at the right time.</p>\r\n<blockquote>\r\n<p><strong>BI Transforms raw data, into useful and meaningful information</strong></p>\r\n</blockquote>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-222ccb10 elementor-widget elementor-widget-image\" data-id=\"222ccb10\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg\" sizes=\"(max-width: 962px) 100vw, 962px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg 962w, https://brainstation-23.com/wp-content/uploads/2021/10/6-300x195.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/6-768x499.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/6-500x325.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/6-800x520.jpg 800w\" alt=\"\" width=\"962\" height=\"625\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/6.jpg 962w, https://brainstation-23.com/wp-content/uploads/2021/10/6-300x195.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/6-768x499.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/6-500x325.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/6-800x520.jpg 800w\" data-sizes=\"(max-width: 962px) 100vw, 962px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-96c74b2 elementor-widget elementor-widget-text-editor\" data-id=\"96c74b2\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: DW &amp; BI concept</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-39db717 elementor-widget elementor-widget-heading\" data-id=\"39db717\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">BI Tools</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-240ebf16 elementor-widget elementor-widget-text-editor\" data-id=\"240ebf16\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>Known also as BI software, is a type of application software designed to retrieve, analyze, transform and report data from data warehouses.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-6a60747f elementor-widget elementor-widget-image\" data-id=\"6a60747f\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/7-300x99.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/7-768x254.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/7-500x166.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/7-800x265.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/7-1280x424.png 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/7.png 1290w\" alt=\"\" width=\"1024\" height=\"339\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/7-1024x339.png 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/7-300x99.png 300w, https://brainstation-23.com/wp-content/uploads/2021/10/7-768x254.png 768w, https://brainstation-23.com/wp-content/uploads/2021/10/7-500x166.png 500w, https://brainstation-23.com/wp-content/uploads/2021/10/7-800x265.png 800w, https://brainstation-23.com/wp-content/uploads/2021/10/7-1280x424.png 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/7.png 1290w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-26bcb012 elementor-widget elementor-widget-text-editor\" data-id=\"26bcb012\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Some popular BI tools</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-1afdde9a elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"1afdde9a\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-ce722c6\" data-id=\"ce722c6\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-b54391a elementor-widget elementor-widget-heading\" data-id=\"b54391a\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">BI Reports</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-79ac919e elementor-widget elementor-widget-text-editor\" data-id=\"79ac919e\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p>BI tools provide features to build analytics reports, dashboard, apps etc. These reports can be published to web services and also can be embedded to other system as required.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-51aa029 elementor-widget elementor-widget-image\" data-id=\"51aa029\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/8-300x160.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/8-768x409.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/8-500x266.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/8-800x426.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/8-1280x681.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/8.jpg 1468w\" alt=\"\" width=\"1024\" height=\"545\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/10/8-1024x545.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/10/8-300x160.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/10/8-768x409.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/10/8-500x266.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/10/8-800x426.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/10/8-1280x681.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/10/8.jpg 1468w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-b2e7e8f elementor-widget elementor-widget-text-editor\" data-id=\"b2e7e8f\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Fig: Sample of a BI dashboard</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-22a88314 elementor-widget elementor-widget-heading\" data-id=\"22a88314\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">How does DW &amp; BI create value for an organization?</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-1085e15b elementor-widget elementor-widget-text-editor\" data-id=\"1085e15b\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<ul>\r\n<li>A data warehouse creates a single source of data that is consistent in format, structured in a uniform way, contains complete and accurate data that can be relied upon, and is up to date</li>\r\n<li>It is structured and designed specifically to allow data to be accessed quickly</li>\r\n<li>It provides a single integrated view of an organisation by combining data from multiple sources</li>\r\n<li>Separate environment from operational systems to facilitate improved query performance for data analytics</li>\r\n<li>Provides a complete data set, allowing you to analyse data from the past to predict the future</li>\r\n<li>BI tools provide intelligent insightful reports based on different KPIs (Key performance Index)</li>\r\n</ul>\r\n<p>All of this delivers value to the business by:</p>\r\n<ul>\r\n<li>Giving managers/stakeholders access to the information they need more quickly and easily, with significantly less ongoing effort to prepare the data</li>\r\n<li>Providing information about the business environment more quickly which means that managers can respond to changes rapidly</li>\r\n<li>Providing information more frequently</li>\r\n</ul>\r\n<p>Thus DW &amp; BI solution turns raw data to insightful information, provides intelligent analytics which leads to better understanding of the business, makes more informed managers, helps to make data driven, objective decisions &ndash; resulting in greater business stability and growth.&nbsp;<a href=\"https://brainstation-23.com/contact/\">Contact us</a>&nbsp;to see how we can help your business harness the power of Business Intelligence &amp; Data Warehouse!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 2, 'Approve', '2021-12-29 11:27:36'),
(4, 'eKYC- Simplifying Customer Onboarding', 'ekyc-simplifying-customer-onboarding', 'The AI powered eKYC is the easiest way for any financial organization to onboard new clients, this blogs expands on how it works!', 'ticon-blog_cover_image/1640762861-1638871299-blog2.jpg', 'it', '<section class=\"elementor-section elementor-top-section elementor-element elementor-element-3a92cb51 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"3a92cb51\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-1c9b5e9a\" data-id=\"1c9b5e9a\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-5a239a06 elementor-widget elementor-widget-text-editor\" data-id=\"5a239a06\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><span class=\"TextRun BCX0 SCXW38616521\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun BCX0 SCXW38616521\">The capabilities of financial applications have been surging with technological advancements like the eKYC. Now the complexity of financial solutions&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW38616521\">has</span><span class=\"NormalTextRun BCX0 SCXW38616521\">&nbsp;given rise to&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW38616521\">many interesting and fascinating digital&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW38616521\">applications that&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW38616521\">make</span><span class=\"NormalTextRun BCX0 SCXW38616521\">&nbsp;it easier for people to get onboard</span><span class=\"NormalTextRun BCX0 SCXW38616521\">.</span><span class=\"NormalTextRun BCX0 SCXW38616521\">&nbsp;eKYC is such an application that is&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW38616521\">derivative</span><span class=\"NormalTextRun BCX0 SCXW38616521\">&nbsp;of the contributions of AI in fintech.</span></span><span class=\"EOP BCX0 SCXW38616521\" data-ccp-props=\"{\">&nbsp;</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-25571cc0 elementor-widget elementor-widget-image\" data-id=\"25571cc0\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1024x576.jpg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1024x576.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-300x169.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-768x432.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1536x864.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-500x281.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-800x450.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1280x720.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100.jpg 1920w\" alt=\"\" width=\"1024\" height=\"576\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1024x576.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1024x576.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-300x169.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-768x432.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1536x864.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-500x281.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-800x450.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100-1280x720.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-1-100.jpg 1920w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-91f1157 elementor-widget elementor-widget-text-editor\" data-id=\"91f1157\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Figure: Capabilities of eKYC</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-4823dfe8 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"4823dfe8\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-39dcd508\" data-id=\"39dcd508\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-747c1300 elementor-widget elementor-widget-text-editor\" data-id=\"747c1300\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><span class=\"TextRun BCX0 SCXW232717656\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun BCX0 SCXW232717656\">Know Your Customer, better known as KYC, is a mandatory&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW232717656\">customer onboarding&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW232717656\">process for banks and financial institutions to know about their clients</span><span class=\"NormalTextRun BCX0 SCXW232717656\">&rsquo; identities, their information and verify them accordingly. And what the eKYC does is b</span><span class=\"NormalTextRun BCX0 SCXW232717656\">ringing the whole pen &amp; paper formalities to the digital platform; allowing anyone with computer device or a smart phone to si</span><span class=\"NormalTextRun BCX0 SCXW232717656\">gn up&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW232717656\">seamlessly</span><span class=\"NormalTextRun BCX0 SCXW232717656\">.</span></span><span class=\"EOP BCX0 SCXW232717656\" data-ccp-props=\"{\">&nbsp;</span></p>\r\n<p><span class=\"TextRun  BCX0 SCXW121906718\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun  BCX0 SCXW121906718\">Before eKYC, the traditional bank account opening formalities were paper-based and&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">often</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">&nbsp;took more than one day.&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">And being&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">paper-based</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">, it was&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">very difficult</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">&nbsp;to verify and&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">validate</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">&nbsp;new customers. Hence, no single individual could open a new account&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">at</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">&nbsp;the same time they have&nbsp;</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">submitted</span><span class=\"NormalTextRun  BCX0 SCXW121906718\">&nbsp;all required information.</span></span><span class=\"EOP  BCX0 SCXW121906718\" data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\">&nbsp;</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"elementor-section elementor-top-section elementor-element elementor-element-15936765 elementor-section-boxed elementor-section-height-default elementor-section-height-default\" data-id=\"15936765\" data-element_type=\"section\">\r\n<div class=\"elementor-container elementor-column-gap-default\">\r\n<div class=\"elementor-row\">\r\n<div class=\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-5644bf94\" data-id=\"5644bf94\" data-element_type=\"column\">\r\n<div class=\"elementor-column-wrap elementor-element-populated\">\r\n<div class=\"elementor-widget-wrap\">\r\n<div class=\"elementor-element elementor-element-52e340d6 elementor-widget elementor-widget-heading\" data-id=\"52e340d6\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Workings of eKYC</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-797ce026 elementor-widget elementor-widget-image\" data-id=\"797ce026\" data-element_type=\"widget\" data-widget_type=\"image.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-image\"><img class=\"attachment-large size-large lazy loaded\" src=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1024x576.jpg\" sizes=\"(max-width: 1024px) 100vw, 1024px\" srcset=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1024x576.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-300x169.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-768x432.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1536x864.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-500x281.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-800x450.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1280x720.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100.jpg 1921w\" alt=\"\" width=\"1024\" height=\"576\" data-src=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1024x576.jpg\" data-srcset=\"https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1024x576.jpg 1024w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-300x169.jpg 300w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-768x432.jpg 768w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1536x864.jpg 1536w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-500x281.jpg 500w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-800x450.jpg 800w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100-1280x720.jpg 1280w, https://brainstation-23.com/wp-content/uploads/2021/12/infographics-2-100.jpg 1921w\" data-sizes=\"(max-width: 1024px) 100vw, 1024px\" data-was-processed=\"true\" /></div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-727205f4 elementor-widget elementor-widget-text-editor\" data-id=\"727205f4\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><em>Figure: Process of eKYC</em></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ab28373 elementor-widget elementor-widget-heading\" data-id=\"ab28373\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">NID Data Collection &amp; Verification</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-2ea6b0b2 elementor-widget elementor-widget-text-editor\" data-id=\"2ea6b0b2\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><strong><span data-contrast=\"auto\">OCR-&nbsp;</span></strong><span data-contrast=\"auto\">For collecting NID data we have developed an optical&nbsp;character recognition feature, or&nbsp;OCR. Our OCR can&nbsp;validate&nbsp;real NID&nbsp;images&nbsp;like&nbsp;smart-card&nbsp;NID,&nbsp;old NID,&nbsp;as well as&nbsp;downloaded NID from Election Commission. In this step customer&nbsp;provide&nbsp;us their NID&rsquo;s front image and back image, where the&nbsp;OCR will read the data from those images&nbsp;in&nbsp;both English and Bangla.</span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\">&nbsp;</span></p>\r\n<p><strong><span data-contrast=\"auto\">NID Data Validation-&nbsp;</span></strong><span data-contrast=\"auto\">In these steps we verify OCR generated data by&nbsp;comparing it&nbsp;with Election Commission data. Bangladesh Bank already&nbsp;provided&nbsp;guideline the matching percentage to verify the NID data.</span><span data-ccp-props=\"{&quot;201341983&quot;:0,&quot;335559739&quot;:160,&quot;335559740&quot;:259}\">&nbsp;</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-500058c elementor-widget elementor-widget-heading\" data-id=\"500058c\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">Biometric Verification</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-860e55a elementor-widget elementor-widget-text-editor\" data-id=\"860e55a\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-text-editor elementor-clearfix\">\r\n<p><span class=\"TextRun BCX0 SCXW168030021\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun BCX0 SCXW168030021\"><strong>Face Verification-</strong>&nbsp;</span></span><span class=\"TextRun BCX0 SCXW168030021\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun BCX0 SCXW168030021\">Face verification has been completed in multiple step verification. Initially we verify the liveliness of customer image.</span><span class=\"NormalTextRun BCX0 SCXW168030021\">&nbsp;This is done through the means of&nbsp;<a href=\"https://aws.amazon.com/rekognition/?blog-cards.sort-by=item.additionalFields.createdDate&amp;blog-cards.sort-order=desc\" target=\"_blank\" rel=\"noopener\">Amazon&nbsp;</a></span><span class=\"NormalTextRun SpellingErrorV2 BCX0 SCXW168030021\"><a href=\"https://aws.amazon.com/rekognition/?blog-cards.sort-by=item.additionalFields.createdDate&amp;blog-cards.sort-order=desc\" target=\"_blank\" rel=\"noopener\">Rekognition</a></span><span class=\"NormalTextRun BCX0 SCXW168030021\">, a</span><span class=\"NormalTextRun BCX0 SCXW168030021\">&nbsp;machine learning solution from&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW168030021\">AWS</span><span class=\"NormalTextRun BCX0 SCXW168030021\">.</span><span class=\"NormalTextRun BCX0 SCXW168030021\">&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW168030021\">Liveliness verification&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW168030021\">is&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW168030021\">done by customer eye blinking as well as&nbsp;</span><span class=\"NormalTextRun BCX0 SCXW168030021\">paling</span><span class=\"NormalTextRun BCX0 SCXW168030021\">&nbsp;customer eye in a predefined rectangular box. If liveliness check verifie</span><span class=\"NormalTextRun BCX0 SCXW168030021\">s</span><span class=\"NormalTextRun BCX0 SCXW168030021\">, then we verify customer image with NID image data.&nbsp;</span></span></p>\r\n<p><strong><span class=\"TextRun SCXW37822076 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW37822076 BCX0\">Fingerprint Verification-</span></span></strong><span class=\"TextRun SCXW37822076 BCX0\" lang=\"EN-US\" xml:lang=\"EN-US\" data-contrast=\"auto\"><span class=\"NormalTextRun SCXW37822076 BCX0\">&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">F</span><span class=\"NormalTextRun SCXW37822076 BCX0\">or further&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">assistance</span><span class=\"NormalTextRun SCXW37822076 BCX0\">, f</span><span class=\"NormalTextRun SCXW37822076 BCX0\">ingerprint verification can&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">provide</span><span class=\"NormalTextRun SCXW37822076 BCX0\">&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">a faster</span><span class=\"NormalTextRun SCXW37822076 BCX0\">&nbsp;and more&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">accurate</span><span class=\"NormalTextRun SCXW37822076 BCX0\">&nbsp;way to&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">validate</span><span class=\"NormalTextRun SCXW37822076 BCX0\">&nbsp;customer identity. We&nbsp;</span><span class=\"NormalTextRun SCXW37822076 BCX0\">directly verify</span><span class=\"NormalTextRun SCXW37822076 BCX0\">&nbsp;the customer fingerprint with Election Commission customer fingerprint.</span></span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 2, 'Approve', '2021-12-29 11:27:34');
